import {Route} from 'wouter';
import Login from "../Login";
import React from "react";

export default function AuthenticatedRoute({ component: C, appProps, ...rest }) {
    return (
        <Route
            {...rest}
            render={props =>
                appProps.isAuthenticated
                    ? <C {...props} {...appProps} />
                    : <Route
                        component={Login} path="/"
                    />}
        />
    );
}
